import { Link, Outlet, useLocation } from "react-router-dom";
import {
  UserIcon,
  ChartBarIcon,
  Cog6ToothIcon,
  DocumentTextIcon,
} from "@heroicons/react/24/outline";
import "../../App.css";

export default function AdminDashboard() {
  const location = useLocation();

  const navItems = [
    { path: "/admin/overview", label: "Overview", icon: ChartBarIcon },
    { path: "/admin/users", label: "Users", icon: UserIcon },
    { path: "/admin/logs", label: "Logs", icon: DocumentTextIcon },
    { path: "/admin/settings", label: "Settings", icon: Cog6ToothIcon },
  ];

  return (
    <div className="dashboard-container flex h-screen font-sans">
      {/* Sidebar */}
      <aside className="w-64 bg-gray-900 text-white p-6 flex flex-col">
        <h2 className="text-2xl font-bold mb-6">Admin Dashboard</h2>
        <nav className="flex flex-col space-y-3">
          {navItems.map((item) => {
            const Icon = item.icon;
            return (
              <Link
                key={item.path}
                to={item.path}
                className={`px-3 py-2 rounded flex items-center hover:bg-gray-700 ${
                  location.pathname === item.path ? "bg-gray-700" : ""
                }`}
              >
                <Icon className="w-5 h-5 mr-2" />
                {item.label}
              </Link>
            );
          })}
        </nav>
      </aside>

      {/* Main content */}
      <main className="flex-1 bg-gray-100 p-8 overflow-y-auto">
        <Outlet />
      </main>
    </div>
  );
}
